      <h2>Project 1<button className = 'btn'>Add</button></h2>
      <h2>Project 2<button className = 'btn'>Add</button></h2>
      <h2>Project 3<button className = 'btn'>Add</button></h2>
    </header>
  )
}

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1>Hello From React App</h1>
          <Projects />
        </header>
      </div>
    );
  }
}

export default App;
